    list:[]
});

const TodoReducer=(state=InitialState,action)=>{
switch(action.type){
    case "TO_ADD":{
    return {list : [...state, setState(action.p)]}
    }
    default : {
 return{state}
    }
}
}
export default TodoReducer;
